import React, { useState } from 'react';
import { View, Text, TextInput, Button } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';

const ProfileScreen = () => {
    const [name, setName] = useState('');
    const [age, setAge] = useState('');
    const [weight, setWeight] = useState('');
    const [height, setHeight] = useState('');

    const saveProfile = () => {
        // Save the profile data to a global context variable or perform any desired actions
        // For simplicity, we'll just log the data here
        console.log('Name:', name);
        console.log('Age:', age);
        console.log('Weight:', weight);
        console.log('Height:', height);
    };

    return (
        <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
            <Text>Profile</Text>
            <TextInput
                placeholder="Name"
                value={name}
                onChangeText={setName}
                style={{ marginVertical: 10, paddingHorizontal: 10, width: 200, height: 40, borderColor: 'gray', borderWidth: 1 }}
            />
            <TextInput
                placeholder="Age"
                value={age}
                onChangeText={setAge}
                keyboardType="numeric"
                style={{ marginVertical: 10, paddingHorizontal: 10, width: 200, height: 40, borderColor: 'gray', borderWidth: 1 }}
            />
            <TextInput
                placeholder="Weight"
                value={weight}
                onChangeText={setWeight}
                keyboardType="numeric"
                style={{ marginVertical: 10, paddingHorizontal: 10, width: 200, height: 40, borderColor: 'gray', borderWidth: 1 }}
            />
            <TextInput
                placeholder="Height"
                value={height}
                onChangeText={setHeight}
                keyboardType="numeric"
                style={{ marginVertical: 10, paddingHorizontal: 10, width: 200, height: 40, borderColor: 'gray', borderWidth: 1 }}
            />
            <Button title="Save Profile" onPress={saveProfile} />
        </View>
    );
};

const HomeScreen = () => (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
        <Text>Age</Text>
    </View>
);

const Tab = createBottomTabNavigator();

export default function App() {
    return (
        <NavigationContainer>
            <Tab.Navigator>
                <Tab.Screen name="Profile" component={ProfileScreen} />
                <Tab.Screen name="Age" component={HomeScreen} />
            </Tab.Navigator>
        </NavigationContainer>
    );
}
